// console.log(items)

useEffect( () => {
    
    axios.get('http://localhost:5000/ItemsList')   
    .then( res => {
        // console.log (res.data)
        setItems({ data:res.data })
    })
    .catch((error) => {
        console.log(error);
    })
   
  });


    return (
        <View >
          <Text>{items.map((item)=>{
              <Text>{item.category} </Text>


          })} </Text>

        </View>
    )
}

